  import React from 'react';
  import { mdx } from '@mdx-js/react';

  export const frontMatter = {
	id: 'getting_started',
	title: 'Getting Started',
	sidebar_label: 'Getting Started'
};
export const metadata = {
  "id": "getting_started",
  "isDocsHomePage": false,
  "title": "Getting Started",
  "description": "The Checkout.com SDK for .NET makes it easy for .NET developers to consume Checkout.com APIs from their .NET Framework and .NET Core applications.",
  "source": "@site/docs/getting_started.md",
  "permalink": "/checkout-sdk-net/getting_started",
  "sidebar_label": "Getting Started",
  "sidebar": "someSidebar",
  "next": {
    "title": "Install",
    "permalink": "/checkout-sdk-net/install"
  }
};
