export const rightToc = [{
  value: 'Get a test account',
  id: 'get-a-test-account',
  children: []
}, {
  value: 'Authentication',
  id: 'authentication',
  children: []
}, {
  value: 'Payload and Responses',
  id: 'payload-and-responses',
  children: []
}];
export const RedirectButton = ({
  text,
  link
}) => <a href={link} target="\_blank" className="get-test-account">{text}</a>;
export const Highlight = ({
  children,
  color
}) => <span style={{
  backgroundColor: color,
  borderRadius: '2px',
  color: '#fff',
  padding: '0.2rem'
}}>
  {children}
</span>;
const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component '" + name + "' was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {
  rightToc,
RedirectButton,
Highlight
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p>{`The Checkout.com SDK for .NET makes it easy for .NET developers to consume Checkout.com APIs from their .NET Framework and .NET Core applications.`}</p>
    <p>{`We have tried to make the SDK as intuitive as possible, staying as close to our `}<a parentName="p" {...{
        "href": "https://api-reference.checkout.com"
      }}>{`API specification`}</a>{` as possible.`}</p>
    <p><a parentName="p" {...{
        "href": "https://ci.appveyor.com/project/checkout/checkout-sdk-net-74764"
      }}><img parentName="a" {...{
          "src": "https://ci.appveyor.com/api/projects/status/6ox0xlfjv11avkdf?svg=true",
          "alt": "AppVeyor Build status"
        }}></img></a>{`
`}<a parentName="p" {...{
        "href": "https://www.nuget.org/packages/CheckoutSDK"
      }}><img parentName="a" {...{
          "src": "https://img.shields.io/nuget/v/CheckoutSDK.svg",
          "alt": "NuGet"
        }}></img></a>{`
`}<a parentName="p" {...{
        "href": "https://www.myget.org/feed/checkout/package/nuget/CheckoutSDK"
      }}><img parentName="a" {...{
          "src": "https://img.shields.io/myget/checkout/vpre/CheckoutSDK.svg",
          "alt": "MyGet Pre Release"
        }}></img></a></p>
    <h2 {...{
      "id": "get-a-test-account"
    }}>{`Get a test account`}</h2>
    <p>{`If you are starting the integration process, and you want to start interacting with Checkout.com's API, you will need a test account, so you can get your API keys.`}</p>

    <RedirectButton text="Get a test account" link="https://www.checkout.com/get-test-account" mdxType="RedirectButton" />
    <h2 {...{
      "id": "authentication"
    }}>{`Authentication`}</h2>

    <p>{`When you sign up for an account, you are given a secret and public API key pair. They will be used to initialise the SDK so you can interact with the various endpoints. You can find the keys by navigating to the Checkout.com's Hub `}<Highlight color="#1877F2" mdxType="Highlight">{`Settings > Channels > API keys Section`}</Highlight>{`.`}</p>
    <p>{`Unless required, most of the endpoints covered by the SDK only need the secret key, without the public key. If you do not use one of those endpoints that require the public key, you do not have to specify it when initializing the SDK.`}</p>
    <div {...{
      "className": "admonition admonition-warning alert alert--danger"
    }}><div parentName="div" {...{
        "className": "admonition-heading"
      }}><h5 parentName="div"><span parentName="h5" {...{
            "className": "admonition-icon"
          }}><svg parentName="span" {...{
              "xmlns": "http://www.w3.org/2000/svg",
              "width": "12",
              "height": "16",
              "viewBox": "0 0 12 16"
            }}><path parentName="svg" {...{
                "fillRule": "evenodd",
                "d": "M5.05.31c.81 2.17.41 3.38-.52 4.31C3.55 5.67 1.98 6.45.9 7.98c-1.45 2.05-1.7 6.53 3.53 7.7-2.2-1.16-2.67-4.52-.3-6.61-.61 2.03.53 3.33 1.94 2.86 1.39-.47 2.3.53 2.27 1.67-.02.78-.31 1.44-1.13 1.81 3.42-.59 4.78-3.42 4.78-5.56 0-2.84-2.53-3.22-1.25-5.61-1.52.13-2.03 1.13-1.89 2.75.09 1.08-1.02 1.8-1.86 1.33-.67-.41-.66-1.19-.06-1.78C8.18 5.31 8.68 2.45 5.05.32L5.03.3l.02.01z"
              }}></path></svg></span>{`warning`}</h5></div><div parentName="div" {...{
        "className": "admonition-content"
      }}><p parentName="div">{`Never share your secret keys. Keep them guarded and secure.`}</p></div></div>
    <h2 {...{
      "id": "payload-and-responses"
    }}>{`Payload and Responses`}</h2>
    <p>{`The SDK makes use of dynamic payloads both for the requests and for the API responses. If you want to see all the parameters that you can provide, as well as examples of possible responses, please follow the Checkout.com `}<a parentName="p" {...{
        "href": "https://api-reference.checkout.com/"
      }}>{`API Reference`}</a>{`.`}</p>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
